          <IonCardContent>
            Como desarrollador fullstak, tome la oportunidad de realizar la migración de componentes de un proyecto desarrollado con la librería vaddin en lenguaje java 7 a react 15 en Javascript. Realice el desarrollo de botónes primarios, secundarios, con iconos y  bread crumbs basados en el estilo de la libreria anterior, logrando una mejora visual en el nuevo módulo.
          </IonCardContent>


        </IonCard>
      </IonContent>
    </IonPage>
  );
};

export default CV;
